import React from "react";
import Row from "./Row";

const Inputs = () => {
  function addRow() {
    return (
      <div>
        <Row />
      </div>
    );
  }
  return (
    <div className="input-div">
      <h2>Grade type Percentage</h2>
      <Row />
      <button className="addRow" onClick={addRow}>
        + Add row
      </button>
    </div>
  );
};

export default Inputs;
